def compute_silhouette_score(datanp, labels) -> float:
    try:
        return metrics.silhouette_score(X=datanp, labels=labels)
    except ValueError:
        return -1


def compute_db_score(datanp, labels) -> float:
    try:
        return metrics.davies_bouldin_score(X=datanp, labels=labels)
    except ValueError:
        return 999  # Davies-Bouldin prefers low values, setting -1 will be counter-productive


def compute_cah_score(datanp, labels) -> float:
    try:
        return metrics.calinski_harabasz_score(X=datanp, labels=labels)
    except ValueError:
        return -1


def compute_fm_score(datanp, labels, name: str) -> float:
    try:
        return metrics.fowlkes_mallows_score(labels_true=labels_true[name], labels_pred=labels)
    except ValueError:
        return -1


def compute_kmeans(k: int, datanp):
    model = cluster.KMeans(n_clusters=k, init='k-means++')
    model.fit(datanp)
    return model.labels_


def compute_kmedoids(k: int, datanp):
    distmatrix = euclidean_distances(datanp)
    fp = kmedoids.fasterpam(distmatrix, k)
    return fp.labels


def compute_kmeans_score(k: int, datanp) -> float:
    model = cluster.KMeans(n_clusters=k, init='k-means++')
    model.fit(datanp)
    labels = model.labels_

    # A partir des tests de comparaison, la silhouette devient trop lente en on mesure avec CAH
    # le TP1 a été fait avec la mesure de silhouette
    #score: float = metrics.silhouette_score(X=datanp, labels=labels)
    return compute_cah_score(datanp, labels)


def compute_kmedoids_score(k: int, datanp):
    distmatrix = euclidean_distances(datanp)
    fp = kmedoids.fasterpam(distmatrix, k)
    # A partir des tests de comparaison, la silhouette devient trop lente en on mesure avec CAH
    # le TP1 a été fait avec la mesure de silhouette
    # score: float = metrics.silhouette_score(X=datanp, labels=fp.labels)
    return compute_cah_score(datanp, fp.labels)


def apply_dbsdcan(datanp, eps: float, min_samples: int) -> tuple[float, list]:
    tps1 = time.time()
    model = cluster.DBSCAN(
        eps=eps,
        min_samples=min_samples
    )
    model = model.fit(datanp)
    tps2 = time.time()
    labels = model.labels_
    return round((tps2 - tps1) * 1000, 2), labels


def apply_hdbsdcan(datanp, min_cluster_size: float, min_samples: int) -> tuple[float, list]:
    tps1 = time.time()
    model = hdbscan.HDBSCAN(
        min_cluster_size=min_cluster_size,
        min_samples=min_samples
    )
    model = model.fit(datanp)
    tps2 = time.time()
    labels = model.labels_
    return round((tps2 - tps1) * 1000, 2), labels